import React, {Component} from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      text: "testx",
    };
  }
  render() {
    return (
      <div>
        <div>{this.text}</div>
      </div>
    );
  }
}

export default App;
